import React, { Component } from 'react';

class WorkContainer extends Component {
  render() {
    return (
      <div className='work-container'>
        <h1>Work Container</h1>
        <p>I guess the CV and JD components should live here</p>
      </div>
    );
  }
}

export default WorkContainer;
